  return (
    <div className="app">
      <header className="app-header">
        <h1>Product Listing</h1>
        <p className="subtitle">Beautiful UI with live data from FakeStoreAPI</p>
      </header>
      <main>
        <ProductList />
      </main>
      <footer className="app-footer">Built with ❤️ — Professional & Colorful Edition</footer>
    </div>
  );
}
